en.account_withdrawal_info:
-When you withdraw, all information such as your project, promotional coupon information will be deleted.
 {br}
 -If you have an outstanding balance, it is impossible to withdraw it.
 {br}
 -If you are the super admin, you need to either transfer your role or delete the project
 {br}
 -Please note that withdrawn accounts cannot be reused or recovered.

ja.account_withdrawal_info:
- 脱退時、あなたのプロジェクト及びプロモーション情報などの全ての情報が削除されます。
{br}
- 有償プロジェクトに対する未払い額があった場合は脱退できません。
{br}
- あなたがの最上位管理者権限であった場合、最上位管理者としての権限を他のメンバーに譲るか、プロジェクトを削除してください。
{br}
- 脱退したアカウントは再利用と復旧ができなくなるので、慎重に進めてください。
{br}

ko.account_withdrawal_info:
- 탈퇴 시, 고객님이 보유하신 프로젝트, 프로모션 쿠폰 정보 등 모든 정보가 삭제됩니다.
{br}
- 유료로 사용한 프로젝트의 미납금이 있는 경우 탈퇴는 불가능합니다.
{br}
- 최고관리자인 경우, 최고관리자 권한을 이양하거나 프로젝트를 삭제해야합니다
{br}
- 탈퇴한 계정은 재사용 및 복구가 불가하오니 신중하게 선택하시기 바랍니다.

